import React from 'react';
import {useCountContext,useCountUpdateContext} from './Number'
export default function Tile(props){
    const count = useCountContext();
    const CountUpdate = useCountUpdateContext()

     let name
        if ((props.c===2 || props.c===5) && (props.r===2 || props.r===5)) {
            name = "singleTileThickCR"
        } else if (props.c===2 || props.c===5) {
            name = "singleTileThickC"
        } else if (props.r===2 || props.r===5){
            name = "singleTileThickR"
        } else {
            name = "singleTile"
        }
    const highligh = {
        backgroundColor: props.highligh? "#59E391" : "white"
    }
    return(
        <Fragment className= {name} onClick = {props.fillTile} >
            {!props.notesMode && <h2 className="number" > {props.number} </h2>}
            {props.notesMode && <h4 className="notes"> {props.note} </h4>}
         </Fragment>
    )
}
